    <script>
      var MAP       = feature_group_bdfabb5d3c4673f8a1863bfca5a88430._map;
      var VENUES    = feature_group_bdfabb5d3c4673f8a1863bfca5a88430;
      var LAYER_CITY= feature_group_469bc286dc7b914571ca4662f282c62c;
      var LAYER_TOP = feature_group_1cd915b3fb95c4a0ea9091aa43e3e7a9;
      var LAYER_HEAT= heat_map_03833263bf5152b535daa03a7891f468;

      // UI → canonical alias map (so "Dance/Electronic" matches EDM)
      var CANON = {
        "Hip-Hop": ["Hip-Hop","Hip-Hop/Rap","Hip Hop","Rap"],
        "EDM": ["EDM","Dance/Electronic","Dance","Electronic","EDM/Dance"],
        "Rock": ["Rock"],
        "Country": ["Country"],
        "Pop": ["Pop"],
        "Latin": ["Latin","Reggaeton","Latin Urban"],
        "R&B": ["R&B","Rnb","Soul"],
        "Jazz": ["Jazz"],
        "Classical": ["Classical","Symphony"],
        "Metal": ["Metal"],
        "Alternative": ["Alternative","Indie"],
        "Folk": ["Folk","Americana"],
        "Reggae": ["Reggae","Dancehall"],
        "Comedy": ["Comedy"],
        "Other": ["Other"]
      };

      function toCanon(label) {
        if (CANON[label]) return label;
        for (var k in CANON) if (CANON[k].indexOf(label) !== -1) return k;
        return label;
      }

      function setLayerVisible(layer, show) {
        if (!MAP || !layer) return;
        if (show) { if (!MAP.hasLayer(layer)) MAP.addLayer(layer); }
        else      { if (MAP.hasLayer(layer)) MAP.removeLayer(layer); }
      }

      function applyGenreFilter(selected) {
        if (!VENUES || !VENUES.eachLayer) return;
        var genre = toCanon(selected);
        var filtered = (genre !== "All");

        // Ensure venues layer is visible when filtering
        setLayerVisible(VENUES, true);

        // Hide/show venue markers (both SVG and Icon)
        VENUES.eachLayer(function(m) {
          try {
            var g = (m && m.options && (m.options.feverGenre || m.options.genre)) || "Other";
            var show = (genre === "All" || g === genre);
            if (m._path)   m._path.style.display   = show ? "" : "none";
            if (m._icon)   m._icon.style.display   = show ? "" : "none";
            if (m._shadow) m._shadow.style.display = show ? "" : "none";
            if (m.setStyle) m.setStyle({opacity: show ? 1 : 0, fillOpacity: show ? 0.85 : 0});
            if (!show && m._popup && m._popup._container) m._popup._container.style.display = "none";
          } catch (e) {}
        });

        // Hide city/top/heat when filtering for clarity; restore on "All"
        setLayerVisible(LAYER_CITY, !filtered);
        setLayerVisible(LAYER_TOP,  !filtered);
        setLayerVisible(LAYER_HEAT, !filtered);
      }

      (function initGenreFilter() {
        var sel = document.getElementById('genreFilter');
        if (!sel) return setTimeout(initGenreFilter, 60);
        L.DomEvent.disableClickPropagation(sel.parentElement);
        applyGenreFilter("All");
        sel.addEventListener('change', function() { applyGenreFilter(this.value); });
      })();
    </script>
